import React from 'react';






const Keep = ()=>{
    return(
        <>
             <div id="noteDiv">
                <p id="note">
                    {savedNote}
                </p>
                <Button id="delbtn">
                    <DeleteIcon id="del" />
                </Button>
            </div>
            <h1> This Keeper App {note} </h1>
        </>
    )
}




export default Keep;
